import { Link } from "react-router-dom";
import styled from "styled-components";

const HeaderFixed = styled.div`
  width: 100%;
  height: 35px;
`;
const TopHead = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
`;

const Nav = styled.div`
  width: 100%;
  height: 35px;
`;

const Navul = styled.ul`
  list-style: none;
  padding-left: 0px;
  margin: 0%;
  width: 100%;
  a {
    color: black;
    float: left;
    height: 100%;
    width: 12%;
    :hover {
      font-weight: 800;
    }
  }
`;

function YenaHeader() {
  return (
    <>
      <HeaderFixed>
        <TopHead>
          <div>logo</div>
          <input placeholder="작품이나 작가의 이름을 검색해보세요."></input>
          <div>로그인</div>
        </TopHead>
        <Nav>
          <Navul>
            <Link to="*">
              <li>작품</li>
            </Link>
            <Link to="*">
              <li>작가</li>
            </Link>
            <Link to="*">
              <li>갤러리</li>
            </Link>
            <Link to="*">
              <li>옥션</li>
            </Link>
            <Link to="*">
              <li>아트페어</li>
            </Link>
            <Link to="*">
              <li>전시</li>
            </Link>
            <Link to="*">
              <li>박물관</li>
            </Link>
            <Link to="*">
              <li>재단</li>
            </Link>
          </Navul>
        </Nav>
      </HeaderFixed>
    </>
  );
}

export default YenaHeader;
